import React, { useState } from 'react';
import GameCanvas from './components/Game/GameCanvas';
import Overlay from './components/UI/Overlay';

function App() {
  const [activeZone, setActiveZone] = useState(null);

  const handleZoneEnter = (zoneId) => {
    setActiveZone(zoneId);
  };

  const handleZoneExit = () => {
    setActiveZone(null);
  };

  return (
    <div className="App" style={{ width: '100vw', height: '100vh', overflow: 'hidden', position: 'relative' }}>
        <GameCanvas onZoneEnter={handleZoneEnter} onZoneExit={handleZoneExit} />
        <Overlay activeZone={activeZone} />
    </div>
  );
}

export default App;
